    "2013-03-14T19:21:58.525874",nt"name": "epht-air-quality-county-pm2-5-and-ozone-indicators-2001-2006",nt"isopen":
    false,nt"url": null,nt"notes": "The EPHT air quality indicator files are
    from a SAS program which calculates the air indicators as developed by CDC's Environmental
    Public Health Tracking (EPHT) Air Team and approved by the Content Working Group
    (CWG) steering committee. The indicators use EPA air quality data (from ambient
    air monitors) and the methodology described in the air team's indicator report.
    Each file contains, for each county having complete monitoring data: the year, state
    FIPS code (individually and combined with county FIPS), county name, county population,
    number of days by county above O3 benchmark (default federal NAAQS), the person-days
    by county above O3 benchmark (default federal NAAQS), county PM2.5 annual avarage,
    percent of monitored days above benchmark (default: US Federal NAAQS), and the number
    of person-days above benchmark (default: Federal NAAQS).",nt"license_title":
